import logo from './logo.svg';
import './App.css';

function App() {






  return (
    <div className="App">
      <header className="App-header">
        Sunrise Avenue Solar Energy Production Forecast!
        <img src={logo} className="App-logo" alt="logo" />
        <form action="/url" method="GET">
          <p>Please enter Longitude and Latitude of your location</p>
          <input type="text" placeholder="Langitude"></input>
          <br></br>
          <input type="text" placeholder="Longitude"></input>
        </form>
        <p>
          AI Venture Project
        </p>
      </header>
    </div>
  );
}

export default App;
